  false,\n\t\"url\": null,\n\t\"notes\": \"The Wind River meets the criteria for inclusion
  in the National Wild and Scenic Rivers System. Subject to valid existing rights,
  the minerals in Federal lands which are made part of this wild river area be withdrawn
  from all forms of appropriation under the mining laws and from operation of the
  mineral leasing laws. Any traditional Native subsistence uses of the river and its
  immediate surroundings should be protected in order to help preserve the cultural
  heritage and lifestyle of local residents.\",\n\t\"license_title\": \"License Not
